import React from 'react';
import '../css/NavBar.css';
// import navLogo from './navLogo.png'
import Logo from "../img/igotchu-darkblue.png";


function NavBar(){
  return(
    <div className="navBar">
      <ul>
              <img className="navLogo" src={Logo} alt='' />
        <li>
          <a href ="/">
            Home
          </a>
        </li>

        <li>
          <a href="/store">
            Store
          </a>
        </li>

        <li>
        <button>
            Logout
        </button>
        </li>
      </ul>
    </div>
  );
}

export default NavBar
